const types = {
  UPDATE_HORARIO: '@horario/UPDATE',
  ADD_HORARIO: '@horario/ADD',
  RESET_HORARIO: '@horario/RESET',
  REMOVE_HORARIO: '@horario/REMOVE',
  SAVE_HORARIO: '@horario/SAVE',
  ALL_HORARIOS: '@horario/GET_ALL',
  ALL_SERVICOS: '@horario/ALL_SERVICOS',
  FILTER_COLABORADORES: '@horario/FILTER_COLABORADORES',
};

export default types;
